    "content": "# 천세륜 | Frontend Engineer\n\n\n![d947564f-64a0-4d2b-b693-98db4151f829.png](https://res.cloudinary.com/dyrdul1dd/image/upload/v1754641241/norkive-notion-images/1754641240379-d947564f-64a0-4d2b-b693-98db4151f829.png)\n\n\n                   *__언더바로 연결된 링크를 클릭 하시면 더 자세한 정보를 알 수 있습니다.\n\n\n# ABOUT\n\n- ‘학구적, 탐구적, 분석적’이라는 말을 자주 듣습니다.\n- 개발자가 되기 전, 광고・홍보AE로 일했습니다.\n- 여전히 질문을 던지고 문제를 정의하고 분석하고 제안하고 기획하는 일을 좋아합니다.\n- 인생에서 알아간 것들을  [사유하고 글로 적](https://www.ryoonwithwisdomtrees.world/writing)습니다.\n- 랜덤하게 [일상로그를 기록](https://www.ryoonwithwisdomtrees.world/thelog)합니다.\n- [보고 듣고 느낀 영감을 수집 & 기록](https://www.ryoonwithwisdomtrees.world/inspiration)합니다.\n- [개발로그](https://www.ryoonwithwisdomtrees.world/techlog)도 틈틈이 적습니다.\n- 좋아하는 [재능으로 작업하고 재능기부도](https://www.ryoonwithwisdomtrees.world/agiveawaylog) 합니다.\n- 2023년 10월 부터 초등부교사로 봉사중입니다.\n- 2024년 02월 부터 방통대 컴퓨터과학과에 재학중입니다.\n\n\n\n\n\n+ 이 외에\n\n    1. 영화는 [테넷](https://namu.wiki/w/%ED%85%8C%EB%84%B7), [인터스텔라](https://namu.wiki/w/%EC%9D%B8%ED%84%B0%EC%8A%A4%ED%85%94%EB%9D%BC), [쇼생크탈출](https://namu.wiki/w/%EC%87%BC%EC%83%9D%ED%81%AC%20%ED%83%88%EC%B6%9C)을 좋아하고\n    2. 책은 올해 [우리는 다시 연결되어야 한다](https://www.aladin.co.kr/m/mproduct.aspx?ItemId=247420735), [아스퍼걸](https://www.aladin.co.kr/m/mproduct.aspx?ItemId=256863232), [자기결정](https://product.kyobobook.co.kr/detail/S000000828451),  [유난한도전](https://www.aladin.co.kr/m/mproduct.aspx?ItemId=303696963) 등을 인상깊게 읽었습니다.\n\n\n\n\n\n# <strong>Career / Education</strong>\n\n- 現 방송통신대학교 <strong>컴퓨터과학과</strong> 3학년 재학중\n- 前 <strong>Frontend</strong> 개발자 @[피노랩](https://pinotlab.co.kr/ko/main/main.php)\n- 前 AI 양재 허브  - <strong>AI · SW 개발자</strong> 양성 과정 수료엘리스 @[엘리스](https://elice.io/ko)\n- 前 <strong>Backend</strong> 개발자 @[그로브소프트](https://www.grovesoft.net/)\n- 前 <strong>JAVA기반</strong> 스마트문화웹앱콘텐츠제작과정 수료 @[비트캠프](https://www.bitcamp.co.kr/)\n- 前 홍보AE @[더컴퍼니](https://m.jobkorea.co.kr/Recruit/Co_Read/C/15312702)\n- 前 홍보AE @[그레이월드와이드 코리아](https://www.grey.com/locations/korea)\n- 前 MD양성과정 수료 @[여성경제인협회](https://kwbiz.or.kr/)\n- 前 [한국항공대학교](http://www.hangkong.ac.kr/web/index.do) 경영학과 졸업\n\n# Skills / Tools\n\n\n\n![스크린샷_2024-06-15_오후_6.43.31.png](https://res.cloudinary.com/dyrdul1dd/image/upload/v1754641243/norkive-notion-images/1754641242925-E1_84_89_E1_85_B3_E1_84_8F_E1_85_B3_E1_84_85_E1_85_B5_E1_86_AB_E1_84_89_E1_85_A3_E1_86_BA_2024-06-15_E1_84_8B_E1_85_A9_E1_84_92_E1_85_AE_6.43.31.png)\n\n\n## 제목 없음\n경험한 \nSkills 역량은\n이렇게 <u>7 levels</u>\n로 분류 / 산정 됩니다.\n\n1. <strong>가장 최근까지 자주, 오랜시간 사용한</strong> \n⇒ JS,  TS, React, Next.js, Vercel\n2. <strong>1에서 3의 중간계에도 위치하는</strong>  \n⇒ TS, React-Native\n3. <strong>여전히 종종 에러와 문법오류를 접하지만 큰 이슈 없이 사용 가능한</strong>\n⇒ CSS, Python, Jquery, MongoDB, React-Native\n4. <strong>사용한지 오래됐지만 단기간에 역량 Boost-up 가능한</strong>\n⇒ Mysql, Oracle, Java, Spring framework\n5. <strong>별다른 어려움 없이 바로 사용 가능했던</strong>\n⇒ Jotai, redux, recoil, Tailwind Css, Styled-components, Matetrial-UI\n6. <strong>여전히 아주 익숙하진 않은</strong>  \n⇒ Amazon Aws, Google Cloud\n7. **내부 아이디어 제안시\n설득과 협의의 일치를 이루고자 할 때\n구상한 Visual을 외부세계에 시각적으로 보여줄 때 잘 사용하는** \n ⇒ Canva, Figma\n\n# Certificate\n\n- TOEIC 970(2018’)\n- OPIC Advanced Low(2018’)\n- <strong>제42회 SQL 개발자 (SQLD)(2021’)</strong>\n- <strong>네트워크관리사2급 필기(2021’)</strong>\n\n# 읽어 주셔서 감사합니다. \n\n\nContact: devseryun@gmail.com",
